import React, { Component, Fragment } from 'react';
import Sidebar from '../Sidebar/Sidebar';
import CreateComponentForm from './CreateComponentForm';
import Empty from '../Empty/Empty';
import Loader from '../UI/Loader/Loader';
import {matchPath,Switch, Route} from 'react-router-dom';
import Snippets from './Snippets';
import Editor from './Editor';
let snippets = [
  {type: 'html', value:'value', id: '1'},
  {type: 'js', value:'value', id: '2'}
];

const menuItems = [
  {link: '#', text: 'Шапки', parentId: 0, id: 1},
  {link: '#', text: 'Шапка 1', parentId: 1, id: 2},
  {link: '#', text: 'Шапка 2', parentId: 1, id: 3},
  {link: '#', text: 'Шапки 3', parentId: 1, id: 4},
  {link: '#', text: 'Футеры', parentId: 0, id: 5},
  {link: '#', text: 'Футер', parentId: 5, id: 6},
];



const projects = [
  { id: 0, name: 'Super project' }
];

class Project extends Component {

  constructor(props) {
    super(props);

    this.state = {
      snippets,
      sidebarItems: [],
      sidebarIsOpen: true,
    }

    this.openCreateComponentForm = this.openCreateComponentForm.bind(this);

    this.match = matchPath(props.location.pathname, {
      path: '/project:projectId'
    });

  }
  

  componentDidMount() {

    if (this.props.currentProject.data === undefined)
      this.props.getProjectById(this.match.params.projectId);

    if (this.props.components.componentsList.data === undefined)
      this.props.getComponents(this.match.params.projectId);
  }

  
  toggleSidebar() {
    this.setState({ sidebarIsOpen: !this.state.sidebarIsOpen });
  }

  addSnippet(e) {
    e.preventDefault();

    if (!this.state.newSnippetType.length > 1)
      return false;
    
    const newSnippet = {
      type: this.state.newSnippetType, 
      id: this.state.newSnippetType + Number(new Date()),
    }

    this.setState({
      snippets: this.state.snippets.concat(newSnippet),
    });

  }

  setNewSnippetType(e) {
    this.setState({ newSnippetType: e.target.value });
  }

  removeSnippet(e) {
    const id = e.currentTarget.attributes.id.value;
    const cleanedSnippets = this.state.snippets.filter(snippet => snippet.id != id); 
    
    if (window.confirm('Really?'))
      this.setState({snippets: cleanedSnippets});
  } 

  onCreateComponent(data) {
  }

  openCreateComponentForm() {
    this.props.openPopup(
      <CreateComponentForm 
        closePopup={this.props.closePopup}
        addNotify={this.props.addNotify}
        createComponent={this.props.createComponent}
        projectId={this.match.params.projectId}
      />
    );
  }

  render() {
    const contentClass = this.state.sidebarIsOpen ? 'content' : 'content hidden-side';
    return (
      <Fragment>
        <Sidebar 
          toggleSidebar={this.toggleSidebar.bind(this)} 
          isOpen={this.state.sidebarIsOpen} 
          projectName
          menuItems={this.props.currentProject.projectStructure} 
          openCreateComponentForm={this.openCreateComponentForm}
          projectId={this.match.params.projectId}
          />
        <div className={contentClass}>
          {this.props.components.componentsList.data === undefined && <Loader />}
          {this.props.components.componentsList && 
            this.props.components.componentsList.data && 
            this.props.components.componentsList.data.length == 0 && 
            <Empty>В этом проекте пока нет компонентов</Empty>}


          <Switch>
            <Route exact path="/project:projectId/component:componentId">
              <Snippets {...this.props} />
            </Route>
            <Route exact path="/project:projectId/component:componentId/snippet:snippetId">
             
            </Route>
          </Switch>
{/*       
          <div className="snippets">
            <div className="snippet active">
              <div className="editor" id="html1">
                <div id="editor-area" className="editor__area"></div>
                <div className="editor__panel">
                  <ul className="editor__controls">
                    <li className="editor__control">
                      <button data-editor="html1" className="editor__button"><i className="fas fa-expand"></i></button>
                    </li>
                    <li className="editor__control">
                      <button className="editor__button"><i className="far fa-copy"></i></button>
                    </li>
                  </ul>
                </div>
              </div>
            </div>

            <div className="snippet">
              <div id="html" className="editor">
                <div id="editor-area" className="editor__area"></div>
                <div className="editor__panel">
                  <ul className="editor__controls">
                    <li className="editor__control">
                      <button data-editor="html" className="editor__button"><i className="fas fa-expand"></i></button>
                    </li>
                    <li className="editor__control">
                      <button className="editor__button"><i className="far fa-copy"></i></button>
                    </li>
                  </ul>
                </div>
              </div>
            </div>
          </div> */}

        </div>
      </Fragment>
    );
  }

}

export default Project;
